import React, {Component} from 'react';
import {Link} from "react-router-dom";

class Page2 extends Component {
    render() {
        return (
            <div>
                <h1>Page2</h1>
                <button><Link to="/page3/:username">Pass My Name</Link></button>
            </div>
        );
    }
}

export default Page2;
